import React, { Component } from "react";
import AWSSoundPlayer from "./Player";

const streamUrl = "./audio/?.mp3";

// some track meta information
const trackTitle = "?";

class Listen extends Component {
  render() {
    return (
      <div>
        <AWSSoundPlayer
          streamUrl={streamUrl}
          trackTitle={trackTitle}
          preloadType="auto"
        />
      </div>
    );
  }
}

export default Listen;
